import React from 'react';
import './Dashboard.css';
import { Line } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

const Dashboard = () => {
  const data = {
    labels: ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'],
    datasets: [
      {
        label: 'Engagement',
        data: [65, 59, 80, 81, 56, 55, 40],
        fill: false,
        backgroundColor: '#9570FF',
        borderColor: '#9570FF',
      },
    ],
  };

  const options = {
    responsive: true,
    plugins: {
      legend: {
        display: true,
        position: 'top',
      },
      title: {
        display: true,
        text: 'User Engagement Over the Week',
      },
    },
  };

  return (
    <div className="dashboard">
      <aside className="sidebar">
        <div className="logo">MONEER</div>
        <nav>
          <ul>
            <li className="active">Dashboard</li>
            <li>Account</li>
            <li>Stats</li>
            <li>Support</li>
          </ul>
        </nav>
      </aside>
      <main className="main-content">
        <header className="header">
          <h1>Hello, Panji Satrya</h1>
        </header>
        <section className="widgets">
          <div className="widget analytics">
            <h3>Analytics</h3>
            <Line data={data} options={options} />
          </div>
          <div className="widget withdraw">
            <button>Withdraw</button>
            <p>Safely withdraw your money anywhere.</p>
          </div>
          <div className="widget stats">
            <h3>Stats</h3>
          </div>
        </section>
        <section className="profile-section">
          <div className="profile">
            <div className="profile-info">
              <img src="profile-picture-url" alt="Profile" />
              <h4>Panji Satrya</h4>
              <p>PRO Account</p>
              <button>View full profile</button>
            </div>
            <div className="transactions">
              <h4>Your last transactions</h4>
              <ul>
                <li>Bank Transfer <span>View details</span> <span>Friday, 27th</span></li>
                <li>Mobile Banking <span>View details</span> <span>Sunday, 8th</span></li>
                <li>E-payment <span>View details</span> <span>Wednesday, 3th</span></li>
              </ul>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Dashboard;
